module.exports = "  <div class=\"aboutContainer\" color=\"primary\" style=\"padding:0px;\">\r\n      <div class=\"aboutBox\" fxLayout=\"column\">\r\n        <h1 style=\"text-align: center;\">About Us</h1>\r\n        <div class=\"aboutText\">\r\n          <p>\r\n            Bob's Computer repair shop custom builds desktop computers and laptops for every need! From home to business to even powerful gaming computers! With over 50 years of experience and locally owned, come and see us at our new location located at 1123 Farnam St, Omaha NE.\r\n            Bob's Computer Repair shop brings to the table a local and personalized experience for each customer as well as a Lifetime Service Guarantee and 24 Hour Customer Support that is backed by our professionally trained tech support staff. So give us a call or stop by in to receive the warmest “Hello”!\r\n          </p>\r\n    </div>\r\n  </div>\r\n</div>\r\n    <div  style=\"text-align: center;margin-top: 8%;;\" class=\"flex-container\" fxLayout=\"row\">\r\n        <h1 fxFlex>Meet some of our Employees</h1>\r\n    </div>\r\n    <div class=\"flex-container employeeContainer\" fxLayout=\"row\"  fxLayoutAlign=\"none\">\r\n        <div style=\"text-align: center;\" class=\"employeeBox\" fxFlex=\"33%\">\r\n              <div class=\"imageAlign\">\r\n                <img class=\"circleImage\" src=\"../../../assets/images/man1.jpg\">\r\n              </div>\r\n              <div class=\"employeeText\">\r\n                <h2>Josh</h2>\r\n                <h4>Customer Representative</h4>\r\n                  <h3>\r\n                    \"Here at Bob's Computer Repair shop I strive to give the best customer service for our customers! I will make\r\n                    sure you leave our shop feeling knowledgeable about our products and the type of services we offer\"\r\n                  </h3>\r\n              </div>\r\n        </div>\r\n        <div class=\"employeeBox\" fxFlex=\"33%\">\r\n            <div class=\"imageAlign\">\r\n              <img class=\"circleImage\" src=\"../../../assets/images/man2.jpg\">\r\n            </div>\r\n            <div class=\"employeeText\">\r\n              <h2>Michael</h2>\r\n              <h4>Tech Support</h4>\r\n              <h3>\r\n                \"Hi I am your go to with any of your tech questions! I will make sure that all your questions get answered and you feel\r\n                happy with all your tech repairs!\"\r\n              </h3>\r\n            </div>\r\n          </div>\r\n      <div class=\"employeeBox\" fxFlex=\"33%\">\r\n          <div class=\"imageAlign\">\r\n            <img class=\"circleImage\" src=\"../../../assets/images/man3.jpg\">\r\n          </div>\r\n          <div class=\"employeeText\">\r\n            <h2>John</h2>\r\n            <h4>Tech Representative</h4>\r\n            <h3>\r\n              \"Here at Bob's Computer Repair shop we make sure that your tech problems are solved! We offer 24/7 tech support and troubleshooting!\"\r\n            </h3>\r\n          </div>\r\n      </div>\r\n  </div>\r\n  <div class=\"flex-container companyContainer\" fxLayout=\"row\"  fxLayoutAlign=\"none\">\r\n      <div class=\"companyStory\">\r\n          <h1 style=\"text-align: center;\">Bob's Computer Repair Shop Story and Values</h1>\r\n          <p>Bob's Computer Repair shop first opened shop in Bob's Hudson garage in Omaha Nebraska. At first Bob was just building computers for his friends\r\n            and family. No one knew a thing about technology and never thought they could afford a home computer of their own! Bob’s friends and family where\r\n            so happy with their computers that they started referring Bob to their own friends and family. Soon enough Bob had over hundreds of orders!\r\n          </p>\r\n          <p>As the orders kept coming and the years went by, they bid farewell to their garage and settled at 1123 Farnam St in Omaha NE. Bob's computer Repair\r\n            shop has grown to over 100 employees and does not seem to stop growing! The shop still offers computer repair and custom building, software updates\r\n            and even virus control! With over 2,000 5-star reviews, it is no surprise that Bob's Computer Repair Shop is one of the most sought out shops in Omaha!\r\n          </p>\r\n          <p>Bob and his wife are known to stop by and help customers from time to time, but their values are shown by their employees every day! Bob wants his\r\n            customers to know, “Our customers aren’t customers they are family!” Bob and his wife are very happy for the success they were given and are known\r\n            to donate old computers to low income areas! They believe that having access to a computer is very important especially with how much technology\r\n            has grown! They hope to continue their success and hope to see you at their shop!</p>\r\n    </div>\r\n</div>\r\n"

